b"The upcoming holidays are already looking brighter! Our friends @PennAndTellerLive share why.

@RioVegas, our final property to reopen company-wide in the U.S. and Canada, will resume operations on December 22 at 10 AM. The hotel will accommodate weekend stays, Thursday through Monday, while the gaming floor will be open seven days a week. We'll see you very soon!

Click our link in bio for all the details."

b"We're thrilled to celebrate the reopening of @cromwellvegas today as the first adults-only hotel & casino on the #LasVegas Strip :sparkles: #OnlyatTheCromwell

@loveislandusa Season 2 winners, Justine & Caleb #Jaleb, joined us for the momentous opening! 

#LinkInBio for the full release"

